import React, { Fragment } from 'react';
import './Navbar.css'

function Navbar() {
    return(
        <Fragment>
            <div className="navbar">
                <div className="navtitle">
                    <h3>SuperHero Booth</h3>
                </div>
                <div>
                    <input type="text" placeholder="Search..." />

                </div>
            </div>
        </Fragment>
    )
}

export default Navbar;
